import React from "react";
import "./Contact.css";

function Contact() {
  return (
    <div className="contact-page">
      <h1>Contact Me</h1>
      <p><strong>Email:</strong> yourname@example.com</p>
      <p><strong>GitHub Profile:</strong>(Enter Github link here)</p>
      <p><strong>LinkedIn Profile: </strong> (Enter Github link here) </p>
    </div>
  );
}

export default Contact;
